script: |
  super -f text -I q483.spq | sort > q483.out

inputs:
  - name: q483.spq
    data: |
      SELECT ALL - col0 * - 68 - col1 FROM tab1 (FORMAT parquet) WHERE NOT NULL NOT IN ( + 83 * - - col0 + + - col2 * + col1, 26 * + col0 / + - 90, + 29 );
  - name: tab1

outputs:
  - name: q483.out
    data: |
